import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import Login from "./Login";

function AuthPage() {
  const [loginStatus, setLoginStatus] = useState("");
  const [registerStatus, setRegisterStatus] = useState("");
  const data = useLocation().state;

  const setInitialTab = () => {
    data.bydefaultTab === "registration"
      ? openRegistrationTab()
      : openLoginTab();
  };

  const openRegistrationTab = () => {
    console.log("setted registration tab");
    setLoginStatus("");
    setRegisterStatus("active");
  };
  const openLoginTab = () => {
    setLoginStatus("active");
    setRegisterStatus("");
  };
  useEffect(() => {
    setInitialTab();
  },[]);

  return (
    <React.Fragment>
      {/* {setInitialTab()} */}

      <div className="w-75  mx-auto">
        {/* <!-- Pills navs --> */}
        <ul
          className="nav nav-pills nav-justified mb-3"
          id="ex1"
          role="tablist"
        >
          <li
            className="nav-item"
            role="presentation"
            onClick={() => {
              openLoginTab();
            }}
          >
            <a
              className={`nav-link ${loginStatus}`}
              id="tab-login"
              data-mdb-toggle="pill"
              href="#pills-login"
              role="tab"
              aria-controls="pills-login"
              aria-selected="true"
            >
              Login
            </a>
          </li>
          <li
            className="nav-item"
            role="presentation"
            onClick={() => {
              openRegistrationTab();
            }}
          >
            <a
              className={`nav-link ${registerStatus}`}
              id="tab-register"
              data-mdb-toggle="pill"
              href="#pills-register"
              role="tab"
              aria-controls="pills-register"
              aria-selected="false"
            >
              Register
            </a>
          </li>
        </ul>
        {/* <!-- Pills navs --> */}

        {/* <!-- Pills content --> */}
        <div className="tab-content">
            loginStatus ? <Login></Login>

          <div
            className={`tab-pane fade show ${registerStatus}`}
            id="pills-register"
            role="tabpanel"
            aria-labelledby="tab-register"
          >
            <form>
              {/* <!-- Name input --> */}
              <div className="form-outline mb-4">
                <input type="text" id="registerName" className="form-control" />
                <label className="form-label" htmlFor="registerName">
                  Name
                </label>
              </div>

              {/* <!-- Username input --> */}
              <div className="form-outline mb-4">
                <input
                  type="text"
                  id="registerUsername"
                  className="form-control"
                />
                <label className="form-label" htmlFor="registerUsername">
                  Username
                </label>
              </div>

              {/* <!-- Email input --> */}
              <div className="form-outline mb-4">
                <input
                  type="email"
                  id="registerEmail"
                  className="form-control"
                />
                <label className="form-label" htmlFor="registerEmail">
                  Email
                </label>
              </div>

              {/* <!-- Password input --> */}
              <div className="form-outline mb-4">
                <input
                  type="password"
                  id="registerPassword"
                  className="form-control"
                />
                <label className="form-label" htmlFor="registerPassword">
                  Password
                </label>
              </div>

              {/* <!-- Repeat Password input --> */}
              <div className="form-outline mb-4">
                <input
                  type="password"
                  id="registerRepeatPassword"
                  className="form-control"
                />
                <label className="form-label" htmlFor="registerRepeatPassword">
                  Repeat password
                </label>
              </div>

              {/* <!-- Checkbox --> */}
              <div className="form-check d-flex justify-content-center mb-4">
                <input
                  className="form-check-input me-2"
                  type="checkbox"
                  onChange={null}
                  value=""
                  id="registerCheck"
                  aria-describedby="registerCheckHelpText"
                />
                <label className="form-check-label" htmlFor="registerCheck">
                  I have read and agree to the terms
                </label>
              </div>

              {/* <!-- Submit button --> */}
              <button type="submit" className="btn btn-primary btn-block mb-3">
                Sign in
              </button>
            </form>
          </div>
        </div>
        {/* <!-- Pills content --> */}
      </div>
    </React.Fragment>
  );
}

export default AuthPage;
